import Data from "./mock-data.json";
import { useState } from "react";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import { Container, Col, Row } from "react-bootstrap";
import {} from "./seatchbutton.css";

export default function App1() {
  const [query, setQuery] = useState("");

  const filteredData = Data.filter((post) =>
    post.email.toLowerCase().includes(query.toLowerCase())
  );

  return (
    <div>
      <input
        placeholder="Enter post Email"
        onChange={(event) => setQuery(event.target.value)}
      />
      {filteredData.map((post) => (
        <div className="box" key={post.id}>
          <Container className="container100">
            <Row className="Container200">
              <Card style={{ width: "18rem" }} className="cards">
                <Card.Img
                  variant="top"
                  src="holder.js/100px180?text=Image cap"
                />
                <Card.Body>
                  <Card.Title>House Title {post.id}</Card.Title>
                  <Card.Text>
                    Some quick example text to build on the card title and make
                    up the bulk of the card's content. {post.first_name}{" "}
                    {post.last_name}
                  </Card.Text>
                </Card.Body>
                <ListGroup className="list-group-flush">
                  <ListGroup.Item>Cras justo odio</ListGroup.Item>
                  <ListGroup.Item>Dapibus ac facilisis in</ListGroup.Item>
                  <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
                </ListGroup>
                <Card.Body>
                  <Card.Link href="#">Card Link</Card.Link>
                  <Card.Link href="#">Another Link</Card.Link>
                </Card.Body>
              </Card>
            </Row>
          </Container>
        </div>
      ))}
    </div>
  );
}
